    false,nt"url": null,nt"notes": "Hauling out behavior and foraging behavior
    of walruses on St. Matthew Island were investigated. Walruses hauled out at two
    sites on St. Matthew throughout the summer of 1982. Their use of the uglit was cyclic
    and regular, but each ugli had a different period, and both differed from periods
    of walrus use at Round Island. Proximity and richness of food resources were suggested
    as important factors affecting periods of cycles.",nt"license_title": "License
